import { types } from "mobx-state-tree";
import { string } from "mobx-state-tree/dist/internal";

export const abilitie=types.model({
    name: types.optional(types.string,''),
    url: types.optional(types.string,'')
})

export const sprite=types.model({
    back_default:types.optional(types.string,''),
    back_shiny:types.optional(types.string,''),
})

export const pokemon1=types.model({
        abilities:types.array(abilitie),
        back_default:types.optional(types.string,''),
        back_shiny:types.optional(types.string,''),
        id:types.optional(types.number,0),
        name:types.optional(types.string,'')
}).actions(self=>({
    change(infor){
        self.abilities=infor.abilities
        self.back_default=infor.back_default
        self.back_shiny=infor.back_shiny
        self.id=infor.id
        self.name=infor.name
    }
}))

const Evolution=types.model({
    name:types.string,
    img:types.string
})
const Evolutions=types.model({
    list:types.optional(types.array(Evolution),[])
})
export const ListEvolution=Evolutions.create()
export const pokemon=pokemon1.create()
